import './App.css';
import Login from './components/Login'
import {Routes, Route} from 'react-router-dom';
import {useSelector} from 'react-redux';
import Home from './components/Home';
function App() {
  const style={
    backgroundImage:useSelector(state => state.loginInfoReducer.backgroundImage)
  };
  const viewSource = useSelector(state => state.loginInfoReducer.backgroundImage);
  console.log(`viewSource:${viewSource}`);
  return (
    <div className="App">
      <img src={viewSource} alt="" />
      <Routes>
        <Route exact path="/" element={<Login />}></Route>
        <Route exact path="/Home" element={<Home />}></Route>
      </Routes>
    </div>
  );
}

export default App;
